import styled from '@emotion/styled'

function Navigation() {
    return(
        <NavigationStyled>
            Nav
        </NavigationStyled>
    )
}

const NavigationStyled = styled.div`
    ul{
        list-style: none;
        padding: 0;
        margin: 0;
        display: flex;

        li{
            margin-left: 10px;
        }

        a{
            text-decoration: none;
            color: #4C9EE3;

            &:hover{
                text-decoration: underline;
            }

            &.active{
                color: #EF6800;
            }
        }
    }
`
